using eCommerceBase.Domain.AggregateModels;
using eCommerceBase.Domain.SeedWork;
using Microsoft.EntityFrameworkCore;
using Microsoft.EntityFrameworkCore.Metadata.Builders;

namespace eCommerceBase.Persistence.EntityConfigurations
{
    public class SliderEC : IEntityTypeConfiguration<Slider>, ISeed<Slider>
    {
        public void Configure(EntityTypeBuilder<Slider> builder)
        {
            builder.HasKey(x => x.Id);
        }

        public List<Slider> GetSeedData()
        {
            return [new Slider("Slider Başlığı","Slider Yazısı","Slider Linki", "data:image/jpeg;base64,"),
                    new Slider("Slider Başlığı","Slider Yazısı","Slider Linki","data:image/jpeg;base64,")
            ];
        }
    }
}
